/// contentA : "&lt;h4 style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;الاسم: د/مصطفى كمال&amp;nbsp;مدبولي.&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;h4 style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;الوظيفة: رئيس مجلس الوزراء المصري الحالي.&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;h5 style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;معلومات حول الدكتور مصطفى مدبولى&lt;/strong&gt;&lt;/h5&gt;\r\n\r\n&lt;p style=&quot;text-align:justify&quot;&gt;كلفه الرئيس عبد الفتاح السيسي بتشكيل الحكومة في 7 يونيو 2018.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align:justify&quot;&gt;وكان يشغل منصب وزير الإسكان والمرافق والمجتمعات العمرانية خلال الفترة من&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align:justify&quot;&gt;فبراير 2014 حتى 6 يونيو&amp;nbsp;2018.&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;rtl&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;rtl&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p dir=&quot;rtl&quot;&gt;&lt;strong&gt;المؤهلات العلمية:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul dir=&quot;rtl&quot;&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;بكالوريوس الهندسة المعمارية، كلية الهندسة &amp;ndash; جامعة القاهرة عام 1988.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;ماجستير في الهندسة المعمارية (تخصص تخطيط مدن)، كلية الهندسة &amp;ndash; جامعة القاهرة&amp;nbsp;عام 1992.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;دبلومة في&amp;nbsp;الدراسات المتقدمة في مجال التخطيط العمراني (إدارة العمران) من معهد دراسات الإسكان والتنمية الحضرية -&amp;nbsp;روتردام&amp;nbsp;- هولندا عام 1993.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;دكتوراه الفلسفة في الهندسة المعمارية (تخصص تخطيط مدن) من كلية الهندسة جامعة القاهرة عام 1997 بنظام الإشراف المشترك مع معهد&amp;nbsp;التخطيط القومي والإقليمي والعمراني بكلية العمارة جامعة &amp;quot;كارلسروه&amp;quot; بألمانيا.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4 style=&quot;text-align:justify&quot;&gt;&amp;nbsp;&lt;/h4&gt;\r\n\r\n&lt;h4 style=&quot;text-align:justify&quot;&gt;&lt;strong&gt;الخبرات المهنية:&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul dir=&quot;rtl&quot;&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;تم تكليفه بتشكيل الحكومة خلفاً&amp;nbsp;لوزارة شريف إسماعيل في 7 يونيو 2018.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;أصدر الرئيس عبد الفتاح السيسي قراراً في 23 نوفمبر 2017 بتولي المهندس مصطفى مدبولي، وزير الإسكان،&amp;nbsp;مهام القائم بأعمال رئيس مجلس الوزراء لحين عودة المهندس شريف إسماعيل رئيس الوزراء من رحلة علاجه بألمانيا، وظل يمارس تلك الصلاحية حتى عودة إسماعيل في يناير 2018.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;شغل منصب وزير الإسكان والمرافق والمجتمعات العمرانية منذ فبراير 2014&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;تولى منصب المدير الإقليمي للدول العربية &amp;quot;ببرنامج الأمم المتحدة للمستوطنات البشرية &amp;ndash; الهابيتات&amp;quot; من نوفمبر 2012 حتى آخر فبراير 2014.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;تولى منصب رئيس مجلس إدارة الهيئة العامة للتخطيط العمراني بوزارة الإسكان والمرافق والتنمية العمرانية من سبتمبر 2009 حتى نوفمبر&amp;nbsp;2011.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;تولى منصب رئيس الهيئة العامة للتخطيط العمراني (ندباً) من أبريل 2008 إلى سبتمبر 2009.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;تولى منصب نائب رئيس مجلس إدارة الهيئة العامة للتخطيط العمراني للتخطيط الإقليمي والبحوث الدراسات (ندباً) من أكتوبر 2007 إلى أبريل&amp;nbsp;2008.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p style=&quot;text-align:justify&quot;&gt;تولى منصب المدير التنفيذي لمعهد التدريب والدراسات الحضرية بمركز بحوث الإسكان والبناء بوزارة الإسكان والمرافق والمجتمعات العمرانية&amp;nbsp;من&amp;nbsp;يناير 2000 إلى يونيو 2004.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n"
/// contentE : "<h4 style=\"text-align:justify\">Name: Dr. Mostafa Kamal Madbouly</h4>\r\n\r\n<h4 style=\"text-align:justify\">Occupation: Current Prime Minister of Egypt</h4>\r\n\r\n<h5 style=\"text-align:justify\">Resum&eacute;</h5>\r\n\r\n<ul>\r\n\t<li style=\"text-align:justify\">June 7th, 2018: President Abdel Fattah El-Sisi decree appointing Dr. Mostafa Kamal Madbouly to form the Government.</li>\r\n\t<li style=\"text-align:justify\">February 2014: June 6th, 2018: The Minister of Housing, Utilities, and Urban Communities.</li>\r\n</ul>\r\n\r\n<h5 style=\"text-align:justify\">&nbsp;</h5>\r\n\r\n<h5 style=\"text-align:justify\">Academic Background</h5>\r\n\r\n<p style=\"text-align:justify\">Madbouly holds a Bachelor of Architecture, Faculty of Engineering from Cairo University in 1988. He got masters&rsquo; degree in Architecture (City Planning Specialization), Faculty of Engineering, Cairo University in 1992. He also earned a Diploma in Advanced Studies in Urban Planning (Urban Management), Institute of Housing and Urban Development Studies, Rotterdam, The Netherlands in 1993. He obtained &nbsp;a PhD in Architecture (City Planning Specialization), Faculty of Engineering, Cairo University in 1997, under the joint supervision of the Institute of National Regional and Urban Planning, Faculty of Architecture, University of Karlsruhe, Germany.</p>\r\n\r\n<h5 style=\"text-align:justify\">Professional and Practical Career</h5>\r\n\r\n<ul>\r\n\t<li style=\"text-align:justify\">Appointed by virtue of the Presidential Decree of President Abdel Fattach El-Sisi to form the new Government succeeding Sherif Ismail, June 7th, 2018.</li>\r\n\t<li style=\"text-align:justify\">Delegated by President Abdel Fattah El-Sisi to assume office as Acting Prime Minister, during medical treatment of Eng. Sherif Ismail in Germany, from November 23rd, 2017 to January 2018.&nbsp;</li>\r\n\t<li style=\"text-align:justify\">The Minister of Housing, Utilities and Urban Communities, 2014.</li>\r\n\t<li style=\"text-align:justify\">The Regional Director for the Arab Countries of &quot;UN-Habitat&quot;, from November 2012 till of February 2014.</li>\r\n\t<li style=\"text-align:justify\">The Chairman of the Board of Directors of the General Authority for Urban Planning, the Ministry of Housing, Utilities and Urban Development, from September 2009 till November 2011.</li>\r\n\t<li style=\"text-align:justify\">The Chairman of the General Authority for Urban Planning (delegated), from April 2008 till September 2009.</li>\r\n\t<li style=\"text-align:justify\">The Chairman of the Board of Directors of the General Authority for Urban Planning for Regional Planning and Research Studies, October 2007 till April 2008.</li>\r\n\t<li style=\"text-align:justify\">The Executive Director of the Institute of Training and Urban Studies, of the Construction and Housing Research Center, the Ministry of Housing, Utilities and Urban Communities, from January 2000 till June 2004.</li>\r\n</ul>\r\n"
